import React from 'react';
import '../../App.css';
import { SideBarNavs } from "./SideBarNavs"


function SideBar() {
  return (
    <div className ="Sidebar">
         <ul>
          {SideBarNavs.map((val, key) => {
            return(
              <li 
              key={key} onClick = {()=> {
                window.location.pathname = val.link;
                }}>
                  
                <div> {val.icon}</div>
                <div>{val.title}</div>
              </li>
            )
          })} 
      </ul>
    </div>
  );
}

export default SideBar;
